package leetcode;

import java.util.HashMap;
import java.util.Map;

public class Q242ValidAnagram {
    public static void main(String[] args) {
        String s = "";
        String t ="";
        System.out.println(isAnagram(s, t));
    }


    public static boolean isAnagram2(String s, String t) {
        int[] charsMap = new int['z'-'a'+1];

        for(char c: s.toCharArray()) {
            int pos = c - 'a';
            charsMap[pos]++;
        }

        for(char c: t.toCharArray()) {
            int pos = c - 'a';
            charsMap[pos]--;
        }

        for(int count: charsMap) {
            if(count != 0) {
                return false;
            }
        }

        return true;
    }


    public static boolean isAnagram1(String s, String t) {
        if(s.length() != t.length()) return false;
        int N = s.length();
        char[] sc = s.toCharArray();
        char[] tc = t.toCharArray();
        int[] sa = new int[26];
        int[] ta = new int[26];
//         小写字母的ascii码范围：97 - 122
        for (int i = 0; i < N; i++){
            sa[sc[i] - 97] = sa[sc[i] - 97] + 1;
            ta[tc[i] - 97] = ta[tc[i] - 97] + 1;
        }
        for (int i = 0; i < 26; i++) {
            if (sa[i] != ta[i]) return false;
        }
        return true;
    }


    public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length()) {
            return false;
        }
        int N = s.length();
        char[] sc = s.toCharArray();
        char[] tc = t.toCharArray();
        HashMap<Character, Integer> sMap = new HashMap<>();
        HashMap<Character, Integer> tMap = new HashMap<>();
        for (int i = 0; i < N; i++){
            if (sMap.containsKey(sc[i])) {
                sMap.put(sc[i], sMap.get(sc[i]) + 1);
            } else {
                sMap.put(sc[i], 1);
            }
            if (tMap.containsKey(tc[i])) {
                tMap.put(tc[i], tMap.get(tc[i]) + 1);
            } else {
                tMap.put(tc[i], 1);
            }
        }
        for (Map.Entry<Character, Integer> entry : sMap.entrySet()) {
            if (!tMap.containsKey(entry.getKey())) {
                return false;
            }
            else if (!entry.getValue().equals(tMap.get(entry.getKey()))) {
                return false;
            }
        }
        return true;
    }
}
